export default props=>{

    let estilo = {

        backgroundColor: props.cor,
        width: '80px',
        height: '80px',
        borderRadius: '5px'
    }

    return (

        <div>
            <div onClick = {play(props.note)} className = 'm-2' style = {estilo}>{props.cifra}</div>
        </div>
    )
}
